import React from 'react'
import NavBar from '../navbar/NavBar'
import Infobox from '../infobox/InfoboxContainer'

class HomeContainer extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            plans: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:5000/plans/all")
            .then(results => results.json())
            .then(plans => {
                this.setState({
                    plans: plans
                })
                console.log(plans)
            })
            .catch(err => console.log(err))
    }

    getAllPlans(type) {
        list = []
        for (let i = 0; i < this.state.plans.length; i++) {
            list.push(<div className="col-md-8"><Infobox type={type}/></div>)
        }
        return list
    }

    render() {
        return (
            <>
            <NavBar />
            <div className="container">
                <div className="row">
                    <div className="col-md-8">{this.getAllPlans("healthcare.jpg", "Health Care", )}</div>
                </div>
            </div>
            </>
        )
    }
}

export default HomeContainer
